import React from 'react'

function Info(props){

    const phoneNumber = props.user.phoneNumber
    const preNumber = phoneNumber.subString(0,3)

    return(
        <header>   
            <div>{props.user.firstName} {props.user.lastName}</div>
            <div>({props.user.areaCode}) {preNumber}</div>
            <div>{props.user.email}</div>
        </header>
    )
}

export default Info
